import React from "react";
import styled from "styled-components";
import theme from "../../Logic/theme";

const { primary, secondary, tri, quad, background, primaryFont } = theme;

const Container = styled.div`
  grid-area: misc;
  width: 100%;
  max-height: 10em;
  display: flex;
  flex-wrap: wrap;
`;

const Box = styled.div`
  width: 7.5em;
  height: 8em;
  margin: 0.25em;
  background-color: ${background};
`;

const MiscStats = () => {
  return (
    <Container>
      <Box />
      <Box />
      <Box />
      <Box />
    </Container>
  );
};

export default MiscStats;
